import React, { useState, useEffect } from "react";
import axios from 'axios';
import Link from "next/link";

import Navigator from "../Elements/Navigator";
import MenuFunctionIcons from "../Elements/MenuFunctionIcons";
import { renderContainer } from "../../../common/utils";

export default function MenuOne({ container }) {
  const [logoUrl, setLogoUrl] = useState('');

  useEffect(() => {
    const fetchLogo = async () => {
      try {
        const response = await axios.get('http://0.0.0.0:8090/api/collections/logo/records');
        const logoData = response.data.items[0];
        setLogoUrl(`http://0.0.0.0:8090/path/to/logo/images/${logoData.image_115x40}`);
      } catch (error) {
        console.error('Error al cargar el logo:', error);
      }
    };

    fetchLogo();
  }, []);

  return (
    <div className="menu -style-1">
      <div className={renderContainer(container)}>
        <div className="menu__wrapper">
          <Link href="/homepages/homepage1">
            <a className="menu__wrapper__logo">
              {logoUrl && <img src={logoUrl} alt="Logo" />}
            </a>
          </Link>
          <Navigator />
          <MenuFunctionIcons />
        </div>
      </div>
    </div>
  );
}
